import React, { Component } from 'react';
import styled from  'styled-components';

 
class PaperHouse extends Component{

    
    render() {
        
        return(
                 <PaperHouseForm>
                     <PaperHouseTitle>PaperHouse</PaperHouseTitle>
                     <VideoForm>
                     <video controls autoPlay>
                         <source src={process.env.PUBLIC_URL+'/video/PaperHouse.mp4'} type="video/mp4"></source>
                     </video>
                     </VideoForm>
                     <GoTop><Top onClick={this.scrollToTop}>시연영상</Top><Top>개발기술서</Top></GoTop>
                 </PaperHouseForm>
        );
    }
}

export default PaperHouse;

const PaperHouseForm = styled.div `
   background-color:#e4e978;
   width:100%;
   height:100%;
   text-align:center;
   display:flow-root;
`

const PaperHouseTitle = styled.h1`
    color: #d37815;
    
`
const VideoForm = styled.div `
  
`

const GoTop = styled.div `
  
  position: fixed;
    width: 890px;
    height: 24.5px;
    left: 1300px;
    top: 500px;
 
    margin:auto;
`
const Top = styled.a`
  color:white;
  
    font-size: 1.15em;
`
